import React, { useState, useEffect } from "react";
import axios from "axios";
import { useForm, useFieldArray } from "react-hook-form";
import { chit_get_url, chit_add_url } from "./url/url";

const Add_chit = () => {
  const { register, control, handleSubmit } = useForm({
    defaultValues: {
      chit_det: {
        chit_name: "",
        Tolal_amount: "",
        Due_amount: "",
        time_preiod: "",
      },
      member_list: [{ name: "" }],
    },
  });

  const { fields, append, remove } = useFieldArray({
    control,
    name: "member_list",
  });

  const [chitList, setChitList] = useState([]);
  const [memberList, setMemberList] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const chitResponse = await axios.get(chit_get_url);
        setChitList(chitResponse.data);

        const memberResponse = await axios.get(member_get_url);
        setMemberList(memberResponse.data.member_list); // Assuming member_list is an array of objects with 'name' property
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  const onSubmit = async (data) => {
    try {
      const response = await axios.post(chit_add_url, data);
      console.log("Server Response:", response.data);
    } catch (error) {
      console.error("Error while submitting data:", error);
    }
  };

  return (
    <div>
      <h2>Add Chit</h2>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div>
          <label>Chit Name:</label>
          <input {...register("chit_det.chit_name")} placeholder="Chit Name" />
        </div>
        <div>
          <label>Chit Amount:</label>
          <input
            {...register("chit_det.Tolal_amount")}
            placeholder="Total Amount"
          />
        </div>
        <div>
          <label>Due Amount:</label>
          <input
            {...register("chit_det.Due_amount")}
            placeholder="Due Amount"
          />
        </div>
        <div>
          <label>Time Period:</label>
          <input
            {...register("chit_det.time_preiod")}
            placeholder="Time Period"
          />
        </div>

        <div>
          <table>
            <tbody>
              {fields.map((item, index) => (
                <tr key={index}>
                  <td>
                    <input
                      {...register(`member_list.${index}.name`)}
                      placeholder="Member Name"
                    />
                  </td>
                  <td>
                    <button type="button" onClick={() => remove(index)}>
                      Remove
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          <button type="button" onClick={() => append({ name: "" })}>
            Add Member
          </button>
        </div>

        <button type="submit">Submit</button>
      </form>

      <h2>Chit List</h2>
      <ul>
        {chitList.map((chit, index) => (
          <li key={index}>{chit.chit_det.chit_name}</li>
        ))}
      </ul>
    </div>
  );
};

export default Add_chit;
